import styled from 'styled-components';

const MiniTagContainer = styled.div`
  margin: 0 5px 10px 0;
  > span {
    margin-right: 5px;
  }
`;

interface Tags {
  tagName: string;
}

const MiniTag = ({ tagName }: Tags) => (
  <MiniTagContainer>
    <span>#</span>
    {tagName}
  </MiniTagContainer>
);

export default MiniTag;
